import React from 'react';
import '../../App.css';
import { css } from "@emotion/react";

const override = css`
  display: block;
  border-color: #242424;
  border-style: solid;
  border-width: 25vh 40vw;
  background-color: #242424;
  padding: 100vh 100%;  
`;

export default function Work() {
  return (
    <div>
    <div className='hero-container'>
    <img src="/images/img-1.jpeg" autoPlay loop muted />
    <div class="container">
    <div class="Title">
        <h1>Work
        <div class="Title__highlight"></div>
        </h1>
        <div class="Title__underline"></div>
        <div aria-hidden class="Title__filled">Work</div>
    </div>
    </div>
    </div>
    <h1 css={override}>Find out more about me below :D</h1>
    </div>

  )}
